pragma solidity 0.6.12;

contract YourContract {
    address public owner;
    address public newowner;
    uint256 public totalsupply;
    string public standard;
    string public name;
    string public symbol;
    uint8 public decimals;
    mapping (address => uint256) public balances;

    constructor() public payable {
        if (sha3(uint256(4) + ((31 + bytes(standard).length / 2) / 32)) <= sha3(uint256(4))) {
            if (sha3(uint256(5) + ((31 + bytes(name).length / 2) / 32)) <= sha3(uint256(5))) {
                if (sha3(uint256(6) + ((31 + bytes(symbol).length / 2) / 32)) <= sha3(uint256(6))) {
                    decimals = 0;
                    owner = msg.sender;
                    totalsupply = 0x1dcd6500;
                    balances[address(this)] = 0x1dcd6500;
                    balances[owner] = 0;
                }
            }
        }
        standard = '0';
    }

    function killMe() public {
        require(msg.sender == owner, "Only the owner can kill this contract");
        selfdestruct(msg.sender);
    }

    function transfer(address _to, uint256 _value) public returns(bool success) {
        require(balances[msg.sender] >= _value, "Insufficient balance");
        balances[msg.sender] -= _value;
        balances[_to] += _value;
        return true;
    }

    function changeOwner(address _newOwner) public {
        require(msg.sender == owner, "Only the owner can change the owner");
        require(_newOwner != address(0), "New owner cannot be a zero address");
        newowner = _newOwner;
    }

    function confirmOwner() public {
        require(msg.sender == newowner, "Only the new owner can confirm ownership");
        owner = newowner;
        newowner = address(0);
    }

    function withdraw_all() public {
        require(msg.sender == owner, "Only the owner can withdraw all");
        msg.sender.transfer(address(this).balance);
    }

    fallback() external payable {
        if (address(this).balance > 0) {
            if ((250 * msg.value / 0xde0b6b3a7640000) > 0) {
                balances[msg.sender] += (250 * msg.value / 0xde0b6b3a7640000);
                balances[address(this)] -= (250 * msg.value / 0xde0b6b3a7640000);
            }
        }
    }
}
```

